import React from 'react'
import { Link, useLocation, useNavigate } from 'react-router-dom'

const Home = () => {

    console.log(useLocation().pathname)
    const navigate = useNavigate()

    const pushButton = (url) => {
        navigate(url)
    }

    return (
        <div>
            <h1>Home</h1>
            <p>

                <button onClick={()=>pushButton('input_mode')}>
                    入力
                </button>
                <button onClick={()=>pushButton("input_mode")}>
                    過去データ参照
                </button>
            </p>
        </div>
    )
}

export default Home;
